import React from "react";
import './App.css';
import NavBar from "./components/NavBar/NavBar";
import {Routes, Route, Navigate} from "react-router-dom";

let App = () => {
  return (
      <React.Fragment>
          <NavBar/>
          <Routes>
              <Route path={'/'} element={<Navigate to={'/contacts/list'}/>}/>
          </Routes>
      </React.Fragment>
  );
}

export default App;
